import React from 'react'

const Filters = () => {
  return (
    <div className='filters-container'>
      <span>
        <strong>Filter by:</strong>
      </span>
      <hr />
      <div className="input-group">
        <input type="text" />
      </div>
    </div>
  )
}

export default Filters;
